 , P12036 ,

<div class="entities" style="line-height: 2.5; direction: ltr">Ceramide stabilizes beta-site amyloid precursor protein-cleaving enzyme 1 and promotes amyloid beta-peptide biogenesis . The lipid second messenger ceramide regulates several biochemical events that occur during aging . In addition , its level is highly elevated in the amyloid-burdened brains of Alzheimer ' s disease patients . Here , we analyzed the impact of aberrant ceramide levels on amyloid beta-peptide ( Abeta ) generation by using a cell-permeable analog of ceramide ,

<div class="entities" style="line-height: 2.5; direction: ltr">Biophysical and pharmacological characterization of hypotonically activated chloride currents in cortical astrocytes . Rat cortical astrocytes regulate their cell volume in response to hypotonic challenge . This regulation is believed to depend largely on the release of chloride or organic osmolytes through anion channels . Using whole-cell recordings , we identified weakly outwardly rectifying chloride currents that could be activated in response to hypotonic challenge . These currents exhibited the following permeability sequence upon replacement of chloride in the bathing solution with various anions : I - &gt; NO3 - &gt; Cl - &gt; Gluc - &gt; or = MeS - &gt; Ise - . Interestingly , extracellular I - , albeit showing the greatest permeability , blocked the currents with an IC50 of approximately 50 mM . Currents were almost completely inhibited by 123 microM P16860 and partially inhibited by 200 microM niflumic acid or 200 microM DIDS . Additionally , the total number of Cl - ions effluxed through the hypotonically activated channels was markedly similar to the total solute efflux during volume regulation . We therefore propose the hypotonically activated chloride channel as a major contributor to volume regulation of astrocytes . To examine potential candidate chloride channel genes expressed by astrocytes , we employed RT-PCR to demonstrate the presence of transcripts for

<h2 style="margin: 0">14</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Splice variants : a homology modeling approach . Splice variants play an important role within the cell in both increasing the proteome diversity and in cellular function . Splice variants are also associated with disease states and may play a role in their etiology . Information about splice variants has , until now , mostly been derived from the primary transcript or through cellular studies . In this study information from the transcript and other studies is combined with tertiary structure information derived from homology models . Through this method we have determined that it is possible to effectively model splice variants . Forty models of splice variants for fourteen proteins were produced . Analysis of the models shows that deletions produce superior model validation values . Additions to sequences where there is little homology become increasingly difficult to model with increasing sequence length . Many of the splicing events are associated with post-translational modification either in the N-terminal region by changing the signal peptide or by affecting the number or availability of glycosylation sites . Often the alternative exon combinations are associated with loss or gain of whole structural units , as opposed to just changing small loop regions . Losing part of the secondary structure may destabilize neighboring parts of the same secondary structure . Detailed analysis is given of four biomedically relevant proteins ( Beta-site Amyloid Precursor Protein Cleaving enzyme ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P56817

 ) ,

</mark>
 , Frataxin and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q30201

</mark>
 ) and their associated splice variant models . The visualization of these possible structures provides new insights about their functionality and the possible etiology of associated diseases .</div>
